import React, { useState, useEffect, useRef } from 'react';
import data from './data';

const ChosungGame = () => {
  const [gameStarted, setGameStarted] = useState(false);
  const [gameOver, setGameOver] = useState(false);
  const [songData, setSongData] = useState({});
  const [chosung, setChosung] = useState('');
  const [score, setScore] = useState(0);
  const [answerResult, setAnswerResult] = useState('');
  const [timer, setTimer] = useState(null);

  const inputRef = useRef(null);

  useEffect(() => {
    if (gameStarted && !gameOver) {
      setTimer(
        setTimeout(() => {
          handleGameOver();
        }, 10000)
      );
    }
  }, [gameStarted, gameOver]);

  const startGame = () => {
    setGameStarted(true);
    setGameOver(false);
    setScore(0);
    generateChosung();
    inputRef.current.focus();
  };

  const generateChosung = () => {
    const randomIndex = Math.floor(Math.random() * data.length);
    const selectedData = data[randomIndex];

    if (selectedData && selectedData.chosung && selectedData.hint) {
      setSongData(selectedData);
      setChosung(selectedData.chosung);
      setAnswerResult('');
      clearTimeout(timer);
      setTimer(
        setTimeout(() => {
          handleGameOver();
        }, 10000)
      );
    }
  };

  const handleChange = (event) => {
    const { value } = event.target;
    if (value === songData.answer) {
      setScore(score + 1);
      clearTimeout(timer);
      generateChosung();
    }
  };

  const handleGameOver = () => {
    setGameStarted(false);
    setGameOver(true);
    clearTimeout(timer);
  };

  const handleTryAgain = () => {
    setGameStarted(false);
    setGameOver(false);
    setScore(0);
  };

  useEffect(() => {
    if (gameOver && answerResult === 'wrong') {
      setTimeout(() => {
        generateChosung();
      }, 3000);
    }
  }, [gameOver, answerResult]);

  useEffect(() => {
    if (answerResult === 'correct') {
      setTimeout(() => {
        setGameStarted(false);
        setGameOver(false);
      }, 3000);
    }
  }, [answerResult]);

  const checkAnswer = (event) => {
    if (event.key === 'Enter') {
      const { value } = event.target;
      if (value === songData.answer) {
        setScore(score + 1);
        clearTimeout(timer);
        setAnswerResult('correct');
      } else {
        setAnswerResult('wrong');
      }
    }
  };

  return (
    <div>
      <h1>Chosung Game</h1>
      {!gameStarted && !gameOver && (
        <button onClick={startGame}>Start Game</button>
      )}
      {gameStarted && !gameOver && (
        <>
          <p>Chosung: {chosung}</p>
          <p>Hint: {songData.hint}</p>
          <input
            type="text"
            onChange={handleChange}
            onKeyDown={checkAnswer}
            ref={inputRef}
          />
        </>
      )}
      {gameOver && (
        <div>
          {answerResult === 'wrong' && (
            <>
              <p>Wrong Answer</p>
              <p>Correct Answer: {songData.answer}</p>
            </>
          )}
          {answerResult === 'correct' && <p>Correct Answer!</p>}
          <p>Your Score: {score}</p>
          <button onClick={handleTryAgain}>Try Again</button>
        </div>
      )}
    </div>
  );
};

export default ChosungGame;
